import React from 'react';
import {
    Container,
    Row,
    Col,
} from 'reactstrap';
import './index.css'

export default class Page3 extends React.Component {
    render() {
        return (
            <Container fluid className="containerpage3">
                <Row className="rowpage3">
                    <Col sm="12" md={{ size: 10, offset: 1 }} className="colpages3">
                        <p>brand</p>
                    </Col>
                </Row>
            </Container>
        );
    }
}
